function createSVG(char) {
    let text = `<svg version="1.0" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20" preserveAspectRatio="xMidYMid meet">
 <text x="50%" y="50%" text-anchor="middle" alignment-baseline="central" dominant-baseline="central" >${char}</text>
 </svg>`.replace(/\n/g, "");
    return svg(text);
}

function svg(text) {
    return `url("data:image/svg+xml;charset=utf8,${encodeURIComponent(text)}")`;
}

